data:

        Fui ao poupa tempo dar entrada no meu seguro e me informaram que preciso entrar com recurso para o seguro no ministério do trabalho na av. Bady Bassit, mas o agendamento é pelo site, e o site diz não ter disponibilidade de agendamento. Estou tentando já há 20 dias. 
A informação que recebi é que a indisponibilidade é pelo sistema esta com problema há 2 meses, que para eu recursar meu seguro preciso ir na cidade mais próxima. Hoje olhando os agendamentos disponíveis o mais próximo é Araraquara e São Carlos, duas horas de viagem. 
Isso é um absurdo, pagamos caro INSS para que sejamos tratados assim, sem respeito algum. 
Quando irão adequar esse sistema?  toda nossa região é atendida por São José do Rio Preto, quantas pessoas estão na minha situação?, já estamos desempregados sem direito a um seguro garantido ao trabalhador por lei. Quem irá pagar os juros das minhas constas?
Falta de respeito isso.         ; 
        Com o falecimento do meu pai, fui com a minha mãe que tem 87 anos para solicitar a pensão por morte. Aqui em Sete Lagoas/MG, o INSS só envia as pensões para o Banco Mercantil, que tem um atendimento horrível, que gasta em média 02:30 (duas horas e meia) para cada atendimento. A minha mãe já possui conta no Bradesco. É um absurdo o INSS não enviar a pensão, para o banco que o contribuinte solicita. Vcs não sabem o que é levar uma pessoa idosa de 87 anos com dificuldade de locomoção, à uma instituição financeira que não tem menor respeito com as pessoas.         ; 
        Ouvidoria completo descaso, fiz várias reclamações, a resposta é sempre automática Indeferida, tenho um desconto junto ao banco  Pan sobre o título do EMPRÉSTIMO E SOBRE RMC 128,90 no valor de 128,90, o banco alega que fiz o empréstimo, então solicitado o contrato o mesmo envia um contrato de de cartão de crédito de 1988 o qual foi foi cancelado, sendo que o desconto foi reclamado e de setembro de último, como se eu o fizesse pois nunca foi feito ou solicitado, mas então se eu não o fiz por onde eu esta o contrato assinado e onde foi tal valor foi creditado          ; 
        boa noite! bom gostaria de reclamar sobre os condutores do teg ,pois neium desse inrrespossavel querem buscar meus filhos em minha residência pois já conversei com vários, minha filha estuda no emei ceu alvarenga e meu filho na escola padre aldo da tofóre ,pois ja falei com varios condutores e ninguém quer pega los, ja falei com o tal do tio dede ,tio milton ,tio carlos,tio prospero,tio marcio esse inrresponsavel nao querem trabalhar so guanhar dinheiro pq nunca vi tanta falta de consideração com os alunos e pais.
espero que resolva isso pq meus filhos tem o direito do transporte escolar sem contar que eles estao combrando pais de alunos para busca espero que se resolva .         ; 
        Fiz o requerimento da minha carteirinha de pescador amador categoria embarcado no dia 05/08/2016 e na mesma data fiz o pagamento bancário por boleto do banco do Brasil e até a data de hoje não consigo imprimir a carteira de pescador e no site não consta o pagamento é aparece que o site está em manutenção e também ninguém respondeu meu email tenho uma pescaria agendada e não consigo imprimir minha carteirinha 
Júlio Lopes

